import dashboardRouter from "./dashboard/dashRouter"
import fitmentRouter  from "./fitment/fitmentRouter"
export let basicRouter = {
  path: "/basic",
  name: "物业服务",
  meta: {
    title: "物业服务",
  },
  component: () => import("views/basic/index"),
  children: [
    dashboardRouter,
    fitmentRouter,
  ],
};
